import NavigationBar from './navbar';
import Homepage from "./homepage"
import './styles.css';

export default function App() {
  return(
    <>
    <div className='page'>
      <div>
        <NavigationBar />
      </div>
      <div>
        <Homepage/>
      </div>
    </div>
    </>
  )
}
